pragma solidity >=0.5.0;

import "./Token.sol";

contract MultiSig is LBCToken { 

    mapping(address => uint) private _owners;

    uint ownersToCount;
    //why does it need?
    uint _transactionId;

    struct Transaction {
        address from;
        address to;
        uint amount;
        uint8 signaturesCount;
        mapping(address => uint8) signatures;
    }

    //why does it need?
    mapping (uint => Transaction) private _transactions;
    //why does it need?
    uint[] private _pendingTransaction;   

    modifier isExistedOwner() {
        require(_owners[msg.sender] == 1);
        _;
    }

    //err?
    //why does it needed
    event Invest(address owner, uint valueamount);
    event TransactionCreated(address from, address to, uint amount, uint transactionId);
    event TransactionCompleted(address from, address to, uint amount, uint transactionId);
    event TransactionSigned(address by, uint transactionId);

    constructor() public {
        _owners[msg.sender] = 1;
        ownersToCount = 1; 
    }

    //to add become an owner you have to pay or forget about it
    //paying for adding helps to prevent spamming owners
    function addOwner(address _newOwner) isExistedOwner public payable {
        _owners[_newOwner] = 1;
        ownersToCount.add(1);

    }
    //cant msg.sender delete himself?
    //do we need remove onwer?
    function removeOwner(address _existedOwner) isExistedOwner public {
        require(_owners[_existedOwner] == 1);
        _owners[_existedOwner] = 0;
        ownersToCount.sub(1);
    }

//change to ERC20 standard

    function invest() isExistedOwner public payable {
        //err?
        emit Invest(msg.sender, msg.value);       
    }

    function withdraw(uint _amount) isExistedOwner public {
        //err?
        transferTo(msg.sender, _amount);
    }

    function transferTo(address _to, uint _amount) isExistedOwner public {
       require(address(this).balance >= _amount);
       uint transactionNum = _transactionId.add(1);
       Transaction memory transaction;
       transaction.from = msg.sender;
       transaction.to = _to;
       transaction.amount = _amount;
       transaction.signaturesCount = 0;

       _transactions[_transactionId] = transaction;
       _pendingTransaction.push(_transactionId);

       emit TransactionCreated(msg.sender, _to, _amount, _transactionId);
    }

    function getPendingTransactions() isExistedOwner view public returns (uint[] memory) {
        return _pendingTransaction;
    }

    function signTransaction(uint transactionId) isExistedOwner public {
        //why storage?

        Transaction storage transaction = _transactions[_transactionId];   
        //why 0x0 ?
        //require(0x0 != transaction.from);

        require(msg.sender != transaction.from);

        require(transaction.signatures[msg.sender] != 1);

        transaction.signatures[msg.sender] = 1;
        transaction.signaturesCount++;   

        emit TransactionSigned(msg.sender, _transactionId); 
        if (transaction.signaturesCount >= countOwners()) {
            //does it work?
            require(address(this).balance >= transaction.amount);
            transferTo(transaction.to, transaction.amount);
            //transaction.to.transfer() doesnt work
            emit TransactionCompleted(transaction.from, transaction.to, transaction.amount, _transactionId);
            deleteTransaction(_transactionId);
        }
    }

    function deleteTransaction(uint _transactionId) isExistedOwner public {
        //why
        uint8 replace = 0;
        for(uint i = 0; i < _pendingTransaction.length; i++) {
           if(1 == replace) {
               _pendingTransaction[i.sub(1)] = _pendingTransaction[i];
           }
           if(_transactionId == _pendingTransaction[i])
           replace = 1; 
        }
        delete _pendingTransaction[_transactionId];
        _pendingTransaction.length.sub(1);
        delete _transactions[_transactionId];
    }

    function balanceOf() view public returns(uint) {
        //err?
        return address(this).balance;
    }

    function countOwners() private returns(uint) {
        return ownersToCount.div(2).add(1);
    }
}

